import React from 'react'
import { BrowserRouter as Route, Redirect, withRouter, Link } from 'react-router-dom'

const Blog = ({ blog }) => {

    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
    }

    return(
        <div style={blogStyle}>
            <Link to={`/blogs/${blog.id}`}>{blog.title}</Link>
        </div>
    )
}


export default Blog
